import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';

const HomePageBox_Two = () => {
    return (
        <View style={styles.box_two_container}>
            <View style={styles.box_two_heading}>
                <Text style={styles.box_two_Style}>Our Staf</Text>
                <Text style={styles.box_two_btn_btnStyle}>Show All</Text>
            </View>

            <View style={styles.box_two__box}>
                <View style={styles.box_one}>
                    <Image source={require("../../assets/hd.png")} style={styles.box_one_img} />
                    <Text>Mia</Text>
                </View>
                <View style={styles.box_one}>
                    <Image source={require("../../assets/hd.png")} style={styles.box_one_img} />
                    <Text>Mia</Text>
                </View>
                <View style={styles.box_one}>
                    <Image source={require("../../assets/hd.png")} style={styles.box_one_img} />
                    <Text>Mia</Text>
                </View>
                <View style={styles.box_one}>
                    <Image source={require("../../assets/hd.png")} style={styles.box_one_img} />
                    <Text>Mia</Text>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    box_two_container: {
        marginTop: '10%',
        height: '50px',
        width: '100%',
        flex: 1,
    },
    box_two_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    box_two_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two_btn_btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two__box: {
        // height: '500px',
        // width: '90vw',
        padding: '20px',
        flexDirection: "row",
        justifyContent: 'center-between',
        alignItems: 'center',
        backgroundColor: "#909090",
    },
    box_one: {
        width: '106px',
        height: '115px',
        flex: 1,
        backgroundColor: "#fff",
        borderRadius: '10px',
        flexDirection: 'column',
        alignItems: 'center',
    },
    box_one_img: {
        width: ' 62px',
        height: ' 62px',
        borderRadius: '10px',
    }
})

export default HomePageBox_Two;
